import React from "react";
import style from "./Body.module.css";
import HeaderBody from "../HeaderBody/HeaderBody";

function Main() {
  return (
    <div className={style.body}>
      <div className={style.container}>
        <HeaderBody />
      </div>
    </div>
  );
}

export default Body;
